declare v_count number := 0;
begin 
  select count(1) into v_count from dba_tables where  table_name like upper('%ChineseCharacterCode%');
  if v_count>0 then  
     execute IMMEDIATE 'drop table config.ChineseCharacterCode';
      commit; 
  end if;
end;
/
--½¨±í
CREATE	TABLE config.ChineseCharacterCode
(
  ID int NOT NULL PRIMARY KEY,
	Character varchar(10) NOT NULL,
	WBCode varchar(10) NOT NULL, 
	SpellCode varchar(10) NOT NULL, 
	WBCode1 varchar(10) NOT NULL,
	SpellCode1 varchar(10) NOT NULL, 
	RowVersion date  NOT NULL 
);
/
--ÐòÁÐ
create sequence config.SEQ_ChineseCharacterCodeID MINVALUE 0 increment by 1 start with 0;
/
--´¥·¢Æ÷
create or replace  trigger config.TR_ChineseCharacterCodeID
before insert
on config.ChineseCharacterCode
for each row
begin
  select SEQ_ChineseCharacterCodeID.nextval into :new.id from dual;
end;
/ 
select * from config.ChineseCharacterCode order by id
